  private _internalHistoryKey = '__INTERNAL_HISTORY_MAP__';

  constructor(params?: DocOpts) {
    super(params);

    this.undoManager = new UndoManager(this.getHistoryMap(), {
      trackedOrigins: new Set([UserAction]),
    });
  }

